import React from 'react'
import styled from 'styled-components'

const Container = styled.div`

`;

const CategoryItem = ({item}) => {
  return (
    <Container>
        <Image src={item.Image}/>
        <Info>
            <Title>{item.Title}</Title>
        </Info>
    </Container>
  )
}

export default CategoryItem
